import React from 'react';
import '../../src/Style/services.css';
import {useHistory} from 'react-router-dom';

const Services = ()=>{
    
    const history = useHistory();

    const personalLoanStyle = {
        borderRadius:"10px",
        backgroundPosition:"center",
        backgroundSize:"cover",
        backgroundImage: `url('./personal_loan.jpg')`
    };

    const bikeLoanStyle = {
        borderRadius:"10px",
        backgroundPosition:"center",
        backgroundSize:"cover",
        backgroundImage: `url('./bike_loan.jpg')`
    };

    const carLoanStyle = {
        borderRadius:"10px",
        backgroundPosition:"center",
        backgroundSize:"cover",
        backgroundImage: `url('./car_loan.jpg')`
    };

    const homeLoanStyle = {
        borderRadius:"10px",
        backgroundPosition:"center",
        backgroundSize:"cover",
        backgroundImage: `url('./home_loan.png')`
    };

    return(


        <div>
            <div style={personalLoanStyle} class="personal-loan">
                <button className="btn btn-outline personal-loan-btn" onClick = {()=>history.push('/services/personalloan')}>Login</button>
            </div>
            <div style={bikeLoanStyle} onClick = {()=>history.push('/services/bikeloan')} class="bike-loan">
               
                
            </div>
            <div style={carLoanStyle} class="car-loan">
                
                
            </div>
            <div style={homeLoanStyle} class="home-loan">
                
                
            </div>

        </div>
        

    );

};

export default Services;
